import React, { Component } from 'react';
class AboutPage extends Component {
  constructor(props) {
    super(props);
    this.state = { articles: [ name= 'a',name= 'b',name= 'c'] };
  }

  render() {
    return (
      <div>
        {this.state.articles.map((article,index) => <li>{article.name}</li>)}
      </div>
    );
  }
}

export default AboutPage;
